    "See all teams in your course, organized by topic. Join a team to collaborate with other learners who are interested in the same topic as you are.": "\u0395\u03bc\u03c6\u03b1\u03bd\u03af\u03c3\u03c4\u03b5 \u03cc\u03bb\u03b5\u03c2 \u03c4\u03b9\u03c2 \u03bf\u03bc\u03ac\u03b4\u03b5\u03c2 \u03c4\u03bf\u03c5 \u03bc\u03b1\u03b8\u03ae\u03bc\u03b1\u03c4\u03bf\u03c2, \u03bf\u03c1\u03b3\u03b1\u03bd\u03c9\u03bc\u03ad\u03bd\u03b5\u03c2 \u03b2\u03ac\u03c3\u03b5\u03b9 \u03b8\u03ad\u03bc\u03b1\u03c4\u03bf\u03c2. \u0393\u03af\u03bd\u03b5\u03c4\u03b5 \u03bc\u03ad\u03bb\u03bf\u03c2 \u03c3\u03b5 \u03ba\u03ac\u03c0\u03bf\u03b9\u03b1 \u03bf\u03bc\u03ac\u03b4\u03b1 \u03b3\u03b9\u03b1 \u03bd\u03b1 \u03c3\u03c5\u03bd\u03b5\u03b9\u03c3\u03c6\u03ad\u03c1\u03b5\u03c4\u03b5 \u03bc\u03b5 \u03ac\u03bb\u03bb\u03bf\u03c5\u03c2 \u03bc\u03b1\u03b8\u03b7\u03c4\u03ad\u03c2, \u03c0\u03bf\u03c5 \u03b5\u03bd\u03b4\u03b9\u03b1\u03c6\u03ad\u03c1\u03bf\u03bd\u03c4\u03b1\u03b9 \u03b3\u03b9\u03b1 \u03c4\u03bf \u03af\u03b4\u03b9\u03bf \u03b8\u03ad\u03bc\u03b1 \u03bc\u03b5 \u03b5\u03c3\u03ac\u03c2.", 
    "Select a chapter": "\u0395\u03c0\u03b9\u03bb\u03ad\u03b3\u03be\u03c4\u03b5 \u03ad\u03bd\u03b1 \u03ba\u03b5\u03c6\u03ac\u03bb\u03b1\u03b9\u03bf", 
