    "You are now enrolled as a verified student for:": "\u0388\u03c7\u03b5\u03c4\u03b5 \u03c0\u03bb\u03ad\u03bf\u03bd \u03b5\u03b3\u03b3\u03c1\u03b1\u03c6\u03b5\u03af \u03c9\u03c2 \u03c0\u03b9\u03c3\u03c4\u03bf\u03c0\u03bf\u03b9\u03b7\u03bc\u03ad\u03bd\u03bf\u03c2 \u03c6\u03bf\u03b9\u03c4\u03b7\u03c4\u03ae\u03c2 \u03b3\u03b9\u03b1 \u03c4\u03bf \u03bc\u03ac\u03b8\u03b7\u03bc\u03b1:", 
